// Prints the 3rd output option - each token found in the program
int analyzeTokens()
{
    FILE *inputFile = fopen(INPUT_FILE, "r");   // Reads the program
    char c; // Will read the program one char at a time

    struct tokNode *root;   // Top of linked list.  Will not change
    struct tokNode *tmp;    // Will traverse the tokNode linked list
    char currTok[TOK_WIDTH];    // The current token symbol
    int symNum;         // Token identifier.  See const int symbols

    int stateNow;   // The current state we are at within "const int edges"
    int statePrev;  // The previous state we were at within "const int edges"
    int stateTotal; // The number of states visited for current symbol.  No more than TOK_WIDTH
    int foundTok;   // 0 if a token (symbol) has not been found.  1 if found.

    /* -- BEGIN: Sets up the linked list to store the tokens -- */
    root = malloc( sizeof(struct tokNode) );    // Creates root node
    // Checks if not enough memory to even create the root node
    if (root == NULL) {
        return -1;
    }
    root->next = NULL;  // Sets the next pointer of root node to null
    root->tokType = 0;  // Sets the default token type to null - non-existent
    tmp = root;     // Starts the tmp pointer at the top of the linked list
    /* -- END: Linked list is ready to use -- */


    // Reads the program one char at a time and saves symbols (tokens) to linked list

    c = fgetc(inputFile);   // Retrieves the first char of the next token
    while ( c != EOF )
    {
        stateNow = 1;   // Initialize at "Begin / End" state of "const int edges"
        statePrev = 1;  // Also initialize at "Begin / End" state of "const int edges"
        stateTotal = 0; // Ensures that no token is longer than TOK_WIDTH
        foundTok = 0;   // Will change to 1 if a token is found
        symNum = 0;     // Will retrieve token name from "const char token"

        // Builds a single token (symbol) of up to TOK_WIDTH chars in length
        while ( (foundTok != 1) && (stateTotal < TOK_WIDTH) && (c != EOF) )
        {
            statePrev = stateNow;
            stateNow = edges[stateNow][(int)c]; // Moves to the next state
            // printf("\tstatePrev = %d\tstateNow = %d\n", statePrev, stateNow); // TEST

            // Found a token if the state is the "Begin / End" state ...
            // ... and the current token consists of at least one character.
            if ( (stateNow == 1 ) && (stateTotal > 0) ) {
                // printf("found symbol!\t");  // TEST
                foundTok = 1;   // True, we found a token
                symNum = symbols[statePrev]; // Retrieves the token (symbol) number
                // printf("symNum = %d\n", symNum);    // TEST
            } else {
                stateTotal++;   // Number of states visited for building current token
                c = fgetc(inputFile);   // Retrieve the next char from the program file
            }

        }

        // Add token to linked list, providing not end of file
        if (c != EOF)
        {
            // If a token was found, then add retrieve its symbol name
            if (foundTok == 1) {
                strcpy(currTok, token[symNum]); // Retrieves the name of the token

            } else {
                strcpy(currTok, "TEMP_VAR");
            }
            setNode(tmp, currTok, symNum);  // Saves the token name and number to a node
            tmp->next = makeTokNode();  // Adds the new node to the linked list
            // If not enough memory to create a new node, then stop program
            if (tmp->next == NULL) {
                return -1;
            }
            tmp = tmp->next;    // Move tmp to the new bottom of the list
        }
    }



    /* -------------------------------------------------------------------- */
    /* --- START OF TEMPORARY DEMO FOR HOW TO ADD TOKENS TO LINKED LIST --- */
    /* -------------------------------------------------------------------- */
//    strcpy(currTok, token[symNum]); // Retrieves the name of the token
//    setNode(tmp, currTok, symNum);  // Add the first value to the linked list
//
//    for (symNum = 1; symNum < 9; symNum++)
//    {
//        tmp->next = makeTokNode();  // Adds the new node to the linked list
//        // If not enough memory to create a new node, then stop program
//        if (tmp->next == NULL) {
//            return -1;
//        }
//        tmp = tmp->next;    // Move tmp to the new bottom of the list
//
//        strcpy(currTok, token[symNum]); // Retrieves the name of the token
//        setNode(tmp, currTok, symNum);  // Add the first value to the linked list
//    }
    /* ------------------------------------------------------------------ */
    /* --- END OF TEMPORARY DEMO FOR HOW TO ADD TOKENS TO LINKED LIST --- */
    /* ------------------------------------------------------------------ */


    // Display the contents of the entire linked list
    printTokens(root);


    // Frees up the nodes in the tokNode linked list
    tmp = root;
    while (tmp->next != NULL) {
        root = tmp;
        free(tmp);
        tmp = root->next;
    }
    free(root);

    return 0;
}


// Creates a new node which could be added to the linked list of tokens.
struct tokNode *makeTokNode()
{
    // Creates a new node of type tokNode
    struct tokNode *nuevoNode;
    nuevoNode = malloc( sizeof(struct tokNode) );

    // Safely initializes the values of the new node
    nuevoNode->next = NULL;
    nuevoNode->tokType = 0;

    // Provides the caller with a pointer to the new node
    return nuevoNode;
}


// Fills an empty node with data - the symbol (token) and symbol number
void setNode(struct tokNode *emptyNode, char *sym, int symNum)
{
    strcpy( emptyNode->tok, sym );  // Sets the name of the token
    emptyNode->tokType = symNum;    // Sets the symbol (token) number
}


// Prints the tokens from the program by traversing the tokType linked list
void printTokens(struct tokNode *head)
{
    printf("tokens:\n-------\n");

    // Print the contents of the tokNode linked list
    while (head != NULL) {
        printf("%-13s\t%d\n", head->tok, head->tokType);
        head = head->next;
    }
}
